(12, 465, 'NCR', 34, 23, 'SS Construction/Survi', '2022-09-28', 'Vendor requested for Escalation on AAC blocks. The issue is open since June, hence we have introduced it as basic rate. IOM under approval.', '', 1, NULL, '2022-09-28 12:24:22', '2022-09-28 12:24:22'),
(13, 514, 'South', 43, 64, ' M/s Spacewood', '2022-09-30', 'Delay in supply & installation works\r\n\r\nStatus: \r\nTotal 8409 out of 9137 Doors delivered.\r\nBalance 728 doors to be delivered by 10th October. \r\nInstallation target was 100 doors per day, presently average 70 doors are installed per day.\r\n', 'Pain to GPL', 1, NULL, '2022-09-30 11:11:48', '2022-09-30 11:11:53'),
(14, 514, 'South', 58, 23, ' M/s. KEC International Limited', '2022-09-30', 'KEC has submitted Reflection Idle Charges Claim (5.2 cr)\r\n\r\nStatus: Claim settlement discussion in progress zonal level.\r\nKEC is insisting for previous agreed settlement of Rs. 3.3 cr till Jan-22.Discussion happened with VP of KEC along with OH, \r\n\r\nAwaiting revert from KEC on the final settlement amount\r\n\r\n', 'Pain to GPL', 1, NULL, '2022-09-30 12:01:26', '2022-09-30 12:01:30'),
(15, 557, 'South', 43, 64, 'M/s Spacewood', '2022-10-06', 'Delivered 8,409 out of 9,137 and Installed 7,885 doors. Balance doors delivery & installation schedule awaited.', '', 1, NULL, '2022-10-06 11:25:47', '2022-10-06 11:25:47'),
(16, 514, 'South', 43, 43, 'Schindler ', '2022-11-04', 'Installation delays. \r\n10 nos works working against requirement of 28 nos for 4 towers and additional 16 nos for T3 & T4 (excluding shifting labours). \r\n\r\nReview to be done based on the dates committed by them on 27-10-2022.', 'Pain to GPL', 1, NULL, '2022-11-04 04:56:59', '2022-11-04 04:57:03');
